import React, { useState } from "react";
import { searchClinics } from "../api";

const SearchForm = ({ setGraphData }) => {
  const [city, setCity] = useState("");
  const [icdCode, setIcdCode] = useState("");

  const handleSearch = async (e) => {
    e.preventDefault();

    try {
      const data = await searchClinics(city, icdCode);
      setGraphData(data);  // ✅ Update GraphXR
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  return (
    <div>
      <h2>Search in GraphXR</h2>
      <form onSubmit={handleSearch}>
        <input 
          type="text" 
          placeholder="Enter city (e.g., Berlin)" 
          value={city} 
          onChange={(e) => setCity(e.target.value)}
        />
        <input 
          type="text" 
          placeholder="Enter ICD Code (e.g., D27)" 
          value={icdCode} 
          onChange={(e) => setIcdCode(e.target.value)}
        />
        <button type="submit">Search</button>
      </form>
    </div>
  );
};

export default SearchForm;
